: rgb(255, 0, 0);\">4</span>：</span><strong><span style=\"margin: 0px; padding: 0px; border: 0px; font-weight: inherit; font-style: inherit; font-size: 9pt; font-family: 宋体; vertical-align: baseline; list-style: none; color: rgb(119, 170, 51);\">会员购买</span></strong><strong><span lang=\"EN-US\" style=\"margin: 0px; padding: 0px; border: 0px; font-weight: inherit; font-style: inherit; font-size: 9pt; font-family: Arial; vertical-align: baseline; list-style: none; color: rgb(119, 170, 51);\">/</span></strong><strong><span style=\"margin: 0px; padding: 0px; border: 0px; font-weight: inherit; font-style: inherit; font-size: 9pt; font-family: 宋体; vertical-align: baseline; list-style: none; color: rgb(119, 170, 51);\">非会员购买</span></strong><strong><span lang=\"EN-US\" style=\"margin: 0px; padding: 0px; border: 0px; font-weight: inherit; font-style: inherit; font-size: 9pt; font-family: Arial; vertical-align: baseline; list-style: none; color: rgb(0, 153, 204);\"><br />\r\n</span></strong><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-size: 9pt; font-family: 宋体; vertical-align: baseline; list-style: none; color: rgb(97, 100, 90);\">如果您是已注册会员，可在左侧会员登陆区登陆后进入订购。如果您不想注册会员，可点击右侧的</span><span lang=\"EN-US\" style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-size: 9pt; font-family: Arial; vertical-align: baseline; list-style: none; color: rgb(97, 100, 90);\">&ldquo;</span><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-size: 9pt; font-family: 宋体; vertical-align: baseline; list-style: none; color: rgb(97, 100, 90);\">非会员购物</span><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-size: 9pt; font-family: Arial; vertical-align: baseline; list-style: none; color: rgb(97, 100, 90);\">&nbsp;</span><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-size: 9pt; font-family: 宋体; vertical-align: baseline; list-style: none; color: rgb(97, 100, 90);\">