INSERT INTO `ecs_article` ( `article_id`, `cat_id`, `title`, `content`, `author`, `author_email`, `keywords`, `article_type`, `is_open`, `add_time`, `file_url`, `open_type`, `link`, `description` ) VALUES  ('49', '15', '上门收款', '<p>&nbsp;<span style=\"color: rgb(51, 51, 51); font-family: 微软雅黑; font-size: 16px; font-weight: 600; line-height: 80px; text-align: center;\">上门收款</span></p>\r\n<div style=\"margin: 0px auto; padding: 0px; font-family: 微软雅黑; line-height: 25px; color: rgb(102, 102, 102);\">我们目前已经开通国内200多个城市的上门收款服务，请来电话查询您所在的城市是否开通此项服务! 上门收款地址在市区需加收20元上门收款费 仅限城区,郊区目前不提供上门收款的服务</div>', '', '', '', '0', '1', '1437635439', '', '0', 'http://', '');
INSERT INTO `ecs_article` ( `article_id`, `cat_id`, `title`, `content`, `author`, `author_email`, `keywords`, `article_type`, `is_open`, `add_time`, `file_url`, `open_type`, `link`, `description` ) VALUES  ('50', '15', '发票说明', '<p>&nbsp;<span style=\"font-size: 9pt; color: rgb(102, 102, 102); font-family: 微软雅黑; line-height: 18px;\">凡在我公司网站购买产品，根据客户要求每张订单均可开具正规发票，此发票可用作单位报销凭证，您在提交订单的时候请写明发票抬头和发票内容，以及收发票地址即可，或者通过电话将发票信息告诉我客服人员。发票将会在款到后2-3个工作日内以快递的方式寄送到您指定的地址，快递费用由我公司承担。</span></p>\r\n<div align=\"left\" style=\"margin: 0px auto; padding: 0px; color: rgb(102, 102, 102); font-family: 微软雅黑; line-height: 18px;\">&nbsp;</div>\r\n<div align=\"left\" style=\"margin: 7.5pt; padding: 0px; color: rgb(102, 102, 102); font-family: 微软雅黑; line-height: 18px;\"><strong>1</strong><strong>、发票抬头</strong><span style=\"font-size: 9pt;\"><br />\r\n</span><span style=\"font-size: 9pt;\">发票抬头内容不能为空，您可写个人或公司名称<br />\r\n</span><strong>2</strong><strong>、发票内容</strong><span style=\"font-size: 9pt;\"><br />\r\n</span><span style=\"font-size: 9pt;\">发票可以选择如下内容：鲜花、礼品、办公用品、蛋糕、食品<br />\r\n</span><strong>3</strong><strong>、发票金额：</strong><strong><span style=\"font-size: 9pt;\"><br />\r\n</span></strong><span style=\"font-size: 9pt;\">金额为商品总金额及运费，不包括代购礼品费用及红包金额。<br />\r\n</span><strong>4</strong><strong>、补开、换开发票说明</strong><span style=\"font-size: 9pt;\"><br />\r\n</span><span style=\"font-size: 9pt;\">（1）发票可以补开一年之内订购的订单。<br />\r\n（2）收到发票后如发现发票抬头、内容或金额等与您下订单时所填写的项目不符，必须在当月第一时间与我们客服联系，请您致电客服400-800-2000联系确认后，将原发票退回西西麦诺蛋糕网予以重开。</span></div>', '', '', '', '0', '1', '1437635460', '', '0', 'http://', '');
INSERT INTO `ecs_article` ( `article_id`, `cat_id`, `title`, `content`, `author`, `author_email`, `keywords`, `article_type`, `is_open`, `add_time`, `file_url`, `open_type`, `link`, `description` ) VALUES  ('51', '20', '关于我们', '<p>&nbsp;<span style=\"text-align: center; line-height: 80px; font-family: 微软雅黑; color: rgb(102,102,102); font-size: 16px; font-weight: 600\">关于我们</span></p>\r\n<div style=\"padding-bottom: 0px; line-height: 18px; margin: 7.5pt; padding-left: 0px; padding-right: 0px; font-family: 微软雅黑; color: rgb(102,102,102); padding-top: 0px\" align=\"left\"><span style=\"font-size: 9pt\">\r\n<div style=\"padding-bottom: 0px; line-height: 25px; margin: 0px auto; padding-left: 0px; padding-right: 0px; padding-top: 0px\"><span style=\"text-transform: none; background-color: rgb(255,255,255); text-indent: 0px; display: inline !important; font: 12px/18px Tahoma, Arial, 宋体, sans-serif; white-space: normal; float: none; letter-spacing: normal; color: rgb(0,0,0); word-spacing: 0px; -webkit-text-stroke-width: 0px\"><font face=\"\">麦香天地（北京）食品有限公司 是西式甜品、手工巧克力、法式马卡龙、婚礼/宴会甜点、节日定制等产品专业生产加工的公司，拥有完整、科学的质量管理体系，进口原材料纯脂熬制以及纯手工制作。麦香天地（北京）食品有限公司 的诚信、实力和产品质量均已获得业界的认可。欢迎各界朋友莅临参观、指导和业务洽谈。联系电话：18600326860. 400-6818-391</font></span></div>\r\n</span></div>\r\n<p>&nbsp;</p>', '', '', '', '0', '1', '1437635937', '', '0', 'http://', '');
